import React from "react";
import '/Users/nadaalotaibi/Downloads/React_Tutorial_Contact_Manager_App-react-crud-axios/src/components/index.css';
import ReactDOM from "react-dom";
import { Button } from 'reactstrap';
import App from "./components/App";
import PageNotFound from "./components/PageNotFound";
import Login from "./components/Login";
import AddContact from "./components/AddContact";
import Clock from "./components/Clock";
// import { Link } from 'react-router';
// import reportWebVitals from './reportWebVitals';

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

ReactDOM.render(
  <Router>

    <center>  
    <div>
    <nav>


    <Clock></Clock>


 <center><img className="photo" src  = "https://www.nescafe.com/mena/sites/default/files/styles/topic_intro_large/public/C011-TopicIntro-DNES_Gold_Coffee_1600x400%28desktop%29.jpg?itok=17dN7mP8" alt= ""></img></center> 

 <ul>

 <div>
    <Button color="google plus" animated="toggle">
      <Button.Content style={{color: '#f1f2f3'}} visible href="#" secondary>
        <Icon name="google plus" /> hi
      </Button.Content>
      <Button.Content style={{color: '#f1f2f3'}}  hidden href="#">
        Connect <Icon name="google plus" />
      </Button.Content>
    </Button>
</div>
 <button class="ui button brown"> <a href="LINK">New Service Request</a></button>
<button type="button"  class="ui button brown" ><Link to= "./">...#</Link>Coffee lovers</button>
<button type="button" class="ui button brown"><Link to= "./Login">...#</Link>Log in</button>


</ul>


<Switch>

    {/* <Route  exact path= '/AddContact'>
       <App />
    </Route>  */}

    <Route exact  path="/Login" >

      <Login/>
      </Route> 

    <Route exact path= '/' > 
    <App />
    </Route>   

    <Route exact path= '/PageNotFound'>
      <PageNotFound></PageNotFound>
    </Route>


    if(<Route exact path = '/PageNotFound'></Route>){
 <center><PageNotFound></PageNotFound>  </center>
    }



    </Switch>
     </nav>
    </div>
    </center>  

      </Router>,

      document.getElementById('root')

);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
